import React from 'react'

const persona = { 
    nombre: 'Martha', 
    edad: 30, 
    direccion: { 
        pais: 'Mexico', 
        estado: 'Nayarit', 
        ciudad: 'Tepic', 
        direccion: 'Conocido No. 533' 
    }
}

export const ObjetosLiterales = () => {
  return (
    <div>
        <h3>Objetos Literales</h3>
    </div>
  )
}
